module IllnessesHelper

  def timeline(counter)
    if counter.even?
      ""
    else
      "timeline-inverted"
    end
  end

  def category_image(type, css='', style='')
    case type
      when "Tema G"
      "<img class='#{css}' style='#{style}' src='data:image/svg+xml;utf8;base64,' />".html_safe
      when "Tema E"
        "<img class='#{css}' style='#{style}' src='data:image/svg+xml;utf8;base64,' />" .html_safe
      when "Tema F"
        "<img class='#{css}' style='#{style}' src='data:image/svg+xml;utf8;base64,'/>".html_safe
      when "Tema H"
        "<img class='#{css}' style='#{style}' src='data:image/svg+xml;utf8;base64,'/>".html_safe
    end
  end
end